pragma solidity ^0.4.23;

import "./SafeMath.sol";
import "./ERC20.sol";
import "./Ownable.sol";
import "./Registry.sol";

contract DataProduct is Ownable {
    using SafeMath for uint256;

    struct Buyer {
        address wallet;
        bool purchased;
        bool approved;
        string publicKey;
        string secret;
        bool rated;
        uint8 rating;
        uint256 price;
    }

    mapping(address => Buyer) buyers;
    address[] buyersAddresses;

    address public registryAddress;
    Registry public registry;

    address public tokenAddress;
    ERC20 private token;

    string public fileHash;
    string public metaHash;
    uint256 public price;
    uint256 public creationTimeStamp;
    uint8 public minScore = 0;
    uint8 public maxScore = 5;
    mapping(uint8 => uint256) public scoreCount;
    uint256 public rateCount;

    uint256 public buyersDeposit;

    event Purchase(address purchaser, address buyer);
    event PurchaseApproval(address purchaser, address buyer);
    event FileHashUpdate(string originalHash, string newHash);
    event MetaHashUpdate(string originalHash, string newHash);
    event PriceUpdate(uint256 originalPrice, uint256 newPrice);

    modifier onlyRegistry() {
        require(msg.sender == registryAddress);
        _;
    }

    modifier onlyApproved() {
        require(buyers[msg.sender].approved);
        _;
    }

    constructor(address _owner, address _tokenAddress, string _fileHash, string _metaHash, uint256 _price) public {
        registryAddress = msg.sender;
        registry = Registry(registryAddress);
        owner = _owner;
        tokenAddress = _tokenAddress;
        token = ERC20(tokenAddress);
        fileHash = _fileHash;
        metaHash = _metaHash;
        price = _price;
        creationTimeStamp = block.timestamp;
    }

    function withdraw() public onlyOwner {
        uint256 balance = token.balanceOf(this);

        require(balance > 0, "1a");
        require(balance > buyersDeposit, "2d");

        assert(token.transfer(owner, balance.sub(buyersDeposit)));
    }

    function setPrice(uint256 newPrice) public onlyOwner {
        emit PriceUpdate(price, newPrice);
        price = newPrice;
    }

    function purchaseFor(address buyerAddress, string buyerPublicKey) public {
        require(owner != buyerAddress);
        require(bytes(buyerPublicKey).length != 0);

        Buyer storage buyer = buyers[buyerAddress];

        require(!buyers[buyerAddress].purchased);

        buyer.purchased = true;

        assert(token.transferFrom(msg.sender, this, price));

        buyer.price = price;
        buyer.wallet = buyerAddress;
        buyer.publicKey = buyerPublicKey;

        buyersAddresses.push(buyerAddress);

        buyersDeposit = buyersDeposit.add(price);

        emit Purchase(msg.sender, buyerAddress);
        registry.registerUserPurchase(buyerAddress);
    }

    function purchase(string publicKey) public {
        purchaseFor(msg.sender, publicKey);
    }

    function approve(address buyerAddress, string secret) public onlyOwner {
        Buyer storage buyer = buyers[buyerAddress];

        require(buyer.purchased);
        require(!buyer.approved);

        buyer.approved = true;
        buyer.secret = secret;

        buyersDeposit = buyersDeposit.sub(buyer.price);
    }

    function rate(uint8 score) public onlyApproved {
        require(score >= minScore && score <= maxScore);

        Buyer storage buyer = buyers[msg.sender];

        if (buyer.rated) {
            uint8 originalScore = buyer.rating;
            require(score != originalScore);
            scoreCount[originalScore] = scoreCount[originalScore].sub(1);
        } else {
            rateCount = rateCount.add(1);
            buyer.rated = true;
        }

        scoreCount[score] = scoreCount[score].add(1);
        buyer.rating = score;

        registry.registerRating(msg.sender, score);
    }

    function cancelRating() public onlyApproved {
        Buyer storage buyer = buyers[msg.sender];

        require(buyer.rated);

        buyer.rated = false;
        uint8 score = buyer.rating;
        scoreCount[score] = scoreCount[score].sub(1);
        buyer.rating = 0;
        rateCount = rateCount.sub(1);
        registry.registerCancelRating(msg.sender);
    }

    function setFileHash(string _fileHash) public onlyOwner {
        require(keccak256(_fileHash) != keccak256(""));
        emit FileHashUpdate(fileHash, _fileHash);
        fileHash = _fileHash;
    }

    function setMetaHash(string _metaHash) public onlyOwner {
        require(keccak256(_metaHash) != keccak256(""));
        emit MetaHashUpdate(metaHash, _metaHash);
        metaHash = _metaHash;
    }

    function getTotalRating() public constant returns (uint256) {
        uint256 total = 0;
        for (uint8 score = minScore; score <= maxScore; score++) {
            total = total.add(scoreCount[score].mul(score));
        }
        return total;
    }

    function getBuyerData(address buyerAddress) public view returns (
        bool _purchased,
        bool _approved,
        string _publicKey,
        string _secret,
        bool _rated,
        uint8 _rating,
        uint256 _price
    ) {
        Buyer storage buyer = buyers[buyerAddress];

        _purchased = buyer.purchased;
        _approved = buyer.approved;
        _publicKey = buyer.publicKey;
        _secret = buyer.secret;
        _rated = buyer.rated;
        _rating = buyer.rating;
        _price = buyer.price;
    }
}
